### YamlMime:TSType
name: Excel.FunctionResult
uid: excel!Excel.FunctionResult:class
package: excel!
fullName: Excel.FunctionResult
summary: >-
  Un objeto que contiene el resultado de una operación de evaluación de funciones


  \[[Conjunto de API: ExcelApi 1,2](/office/dev/add-ins/reference/requirement-sets/excel-api-requirement-sets)\]
remarks: ''
isPreview: false
isDeprecated: false
type: class
properties:
- name: context
  uid: excel!Excel.FunctionResult#context:member
  package: excel!
  fullName: context
  summary: Contexto de la solicitud asociado al objeto. Esto conecta el proceso del complemento con el proceso de la aplicación host de Office.
  remarks: ''
  isPreview: false
  isDeprecated: false
  syntax:
    content: 'context: RequestContext;'
    return:
      type: <xref uid="excel!Excel.RequestContext:class" />
- name: error
  uid: excel!Excel.FunctionResult#error:member
  package: excel!
  fullName: error
  summary: >-
    Valor de error (como " \# div/0") que representa el error. Si no se establece la cadena de error, la función se ha ejecutado correctamente y su resultado se escribe en el campo valor. El error siempre está en la configuración regional de inglés.


    \[[Conjunto de API: ExcelApi 1,2](/office/dev/add-ins/reference/requirement-sets/excel-api-requirement-sets)\]
  remarks: ''
  isPreview: false
  isDeprecated: false
  syntax:
    content: 'readonly error: string;'
    return:
      type: string
- name: value
  uid: excel!Excel.FunctionResult#value:member
  package: excel!
  fullName: value
  summary: >-
    El valor de la evaluación de la función. El campo valor solo se rellenará si no se ha producido ningún error (es decir, la propiedad error no está establecida).


    \[[Conjunto de API: ExcelApi 1,2](/office/dev/add-ins/reference/requirement-sets/excel-api-requirement-sets)\]
  remarks: ''
  isPreview: false
  isDeprecated: false
  syntax:
    content: 'readonly value: T;'
    return:
      type: T
methods:
